    [],nt"revision_timestamp": "2015-07-06T12:37:01.142978",nt"name": "2014-cartographic-boundary-file-combined-statistical-area-for-united-states-1-2000000073b91",nt"isopen":
    false,nt"url": null,nt"notes": "The 2014 cartographic boundary KMLs are
    simplified representations of selected geographic areas from the U.S. Census Bureau's
    Master Address File / Topologically Integrated Geographic Encoding and Referencing
    (MAF/TIGER) Database (MTDB). These boundary files are specifically designed for
    small-scale thematic mapping. When possible, generalization is performed with the
    intent to maintain the hierarchical relationships among geographies and to maintain
    the alignment of geographies within a file set for a given year. Geographic areas
    may not align with the same areas from another year. Some geographies are available
    as nation-based files while others are available only as state-based files.nnCombined
    Statistical Areas (CSAs) are defined by the Office of Management and Budget (OMB)
    and consist of two or more adjacent Core Based Statistical Areas (CBSAs) that have
    significant employment interchanges.  The CBSAs that combine to create a CSA retain
    separate identities within the larger CSA.  Because CSAs represent groupings of
    CBSAs, they should not be ranked or compared with individual CBSAs.",nt"license_title":
